import { IonContent, IonPage, IonButton, IonSplitPane, IonRouterOutlet } from '@ionic/react';
import React from 'react';
import './Home.css';
import tools from '../components/Tools';
import Widgets from '../components/Widgets';
import Menu from '../components/Menu';
const Home: React.FC = () => {
  return (
    <IonPage>
      <Widgets.routes/>

          <IonContent fullscreen>
            <Widgets.Header/>

            <IonButton onClick={()=>{
              tools.clickById("login")
            }}>login</IonButton>
            <IonButton onClick={()=>{
              tools.clickById("recover")
            }}>recover</IonButton>
            <IonButton onClick={()=>{
              tools.clickById("register")
            }}>register</IonButton>
          </IonContent>


    </IonPage>
  );
};

export default Home;
